    user : User
}



const UserItem = ({user}: userProps) => {


    return (
        <Grid container spacing={4} lg={12} alignContent="center">
            <Grid item lg= {8} padding={2}>

                    <Button size="large" 
                    variant="contained"
                    bgColor="#E3F2F0">
                    <p> {user.data} </p>  
                    </Button>


            </Grid>

            <Divider />

        </Grid>
    )
}

export default UserItem;
